          <button nz-button (click)="addHeader()">Add Header</button>
        </div>
        <div>Below is a header template</div>
        @if (headerTemplate) {
          @if (typeof headerTemplate === 'string') {
            <div>{{ headerTemplate }}</div>
          } @else {
            <ng-container *ngTemplateOutlet="headerTemplate"></ng-container>
          }
        }
      `,
    };
  },
}

